import React from 'react';
import ControlledCarousel from './ControlledCarousel';


export default class App extends React.Component {

    render() {
        return (
            <div className="container">
                <div className="row">
                    <div className="col-md-12 responsive">
                        <ControlledCarousel/>
                    </div>
                </div>
            </div>
                )
        }
}
